import { useState } from "react";

function Cards() {
  const [items, setItems] = useState([
    { id: 1, img: "../../public/assets/images/audi.png", stat: "" },
    { id: 1, img: "../../public/assets/images/audi.png", stat: "" },
    { id: 2, img: "../../public/assets/images/bmw.jpeg", stat: "" },
    { id: 2, img: "../../public/assets/images/bmw.jpeg", stat: "" },
    { id: 3, img: "../../public/assets/images/ferrari.png", stat: "" },
    { id: 3, img: "../../public/assets/images/ferrari.png", stat: "" },
    { id: 4, img: "../../public/assets/images/lamborghini.png", stat: "" },
    { id: 4, img: "../../public/assets/images/lamborghini.png", stat: "" },
    { id: 5, img: "../../public/assets/images/Mercedes.png", stat: "" },
    { id: 5, img: "../../public/assets/images/Mercedes.png", stat: "" },
    { id: 6, img: "../../public/assets/images/porsche.png", stat: "" },
    { id: 6, img: "../../public/assets/images/porsche.png", stat: "" },
    { id: 7, img: "../../public/assets/images/rolls.jpeg", stat: "" },
    { id: 7, img: "../../public/assets/images/rolls.jpeg", stat: "" },
    { id: 8, img: "../../public/assets/images/volvo.png", stat: "" },
    { id: 8, img: "../../public/assets/images/volvo.png", stat: "" },
  ]);
  return "Cards";
}

export default Cards;
